import React from 'react';

function BlogPage() {

const carList = [
  { brand:"BMW", color:"Red"  },
  { brand:"Ford", color:"Blue"  },
  { brand:"Tesla", color:"Green"  },
]

  return (
    <div>
      <h1>Blog Page</h1>
      <ul>
        {carList.map((car)=>{car.brand , car.color})}
        <li>1</li>
        <li>2</li>
        <li>3</li>
      </ul>
    </div>
  );
}

export default BlogPage;
